import ValleyOfFire from '../images/valley-of-fire.png';
import data from '../data'
console.log(data.location);

function Destination() {
  return (
    <div className='destination-container'>
      <div className='image-container'>
        <img src={ValleyOfFire}></img>
      </div>
      <div className='description-container'>
        <div className='navigation'>
          <span class="destination-pin material-symbols-outlined">location_on</span>
          <span className='location'>NEVADA</span>
          <span className='map-link'><a href='#'>View on Google Maps</a></span>
        </div>
        <h2 className='atraction'>Valley of Fire</h2>
        <p className='date'>14 Mar, 2020 - 20 Mar, 2020</p>
        <p className='fact' >Valley of Fire derives its name from red sandstone formations, which formed from shifting sand dunes 150 million years ago.</p>

      </div>
    </div>
  );
};

export default Destination;
